import React from 'react';
import { Box, Typography, Container, Button, Grid, Paper } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { School, MenuBook, Dashboard, Groups } from '@mui/icons-material';

const HomePage = () => {
  const navigate = useNavigate();

  const features = [
    {
      icon: <School sx={{ fontSize: 50 }} />,
      title: 'University Management',
      description: 'Manage university information, locations, and departments',
      color: '#3f51b5'
    },
    {
      icon: <MenuBook sx={{ fontSize: 50 }} />,
      title: 'Course Management',
      description: 'Create, update, and manage academic courses',
      color: '#f50057'
    },
    {
      icon: <Dashboard sx={{ fontSize: 50 }} />,
      title: 'Real-time Dashboard',
      description: 'Monitor system statistics and performance',
      color: '#4caf50'
    },
    {
      icon: <Groups sx={{ fontSize: 50 }} />,
      title: 'Microservices Architecture',
      description: 'Built with Spring Boot and React',
      color: '#ff9800'
    }
  ];

  return (
    <Container maxWidth="lg">
      <Box
        sx={{
          py: 8,
          textAlign: 'center',
          background: 'linear-gradient(45deg, #3f51b5 30%, #2196f3 90%)',
          borderRadius: 2,
          mb: 6,
          color: 'white'
        }}
      >
        <Typography variant="h2" component="h1" gutterBottom>
          University Management System
        </Typography>
        <Typography variant="h5" gutterBottom>
          A complete solution for managing universities and courses
        </Typography>
        <Box sx={{ mt: 4 }}>
          <Button
            variant="contained"
            sx={{ mr: 2, backgroundColor: 'white', color: '#3f51b5' }}
            onClick={() => navigate('/dashboard')}
          >
            Go to Dashboard
          </Button>
          <Button
            variant="outlined"
            sx={{ borderColor: 'white', color: 'white' }}
            onClick={() => navigate('/universities')}
          >
            Manage Universities
          </Button>
        </Box>
      </Box>

      <Grid container spacing={4}>
        {features.map((feature, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <Paper
              sx={{
                p: 3,
                textAlign: 'center',
                height: '100%',
                transition: 'transform 0.3s',
                '&:hover': {
                  transform: 'translateY(-5px)',
                  boxShadow: 6
                }
              }}
            >
              <Box sx={{ color: feature.color, mb: 2 }}>
                {feature.icon}
              </Box>
              <Typography variant="h6" gutterBottom>
                {feature.title}
              </Typography>
              <Typography color="textSecondary">
                {feature.description}
              </Typography>
            </Paper>
          </Grid>
        ))}
      </Grid>

      <Box sx={{ mt: 8, textAlign: 'center' }}>
        <Typography variant="h5" gutterBottom>
          Technologies Used
        </Typography>
        <Box sx={{ display: 'flex', justifyContent: 'center', gap: 4, mt: 3, flexWrap: 'wrap' }}>
          <Paper sx={{ p: 2, minWidth: 120 }}>
            <Typography variant="body2" color="textSecondary">Backend</Typography>
            <Typography variant="body1">Spring Boot</Typography>
          </Paper>
          <Paper sx={{ p: 2, minWidth: 120 }}>
            <Typography variant="body2" color="textSecondary">Frontend</Typography>
            <Typography variant="body1">React</Typography>
          </Paper>
          <Paper sx={{ p: 2, minWidth: 120 }}>
            <Typography variant="body2" color="textSecondary">Database</Typography>
            <Typography variant="body1">MySQL</Typography>
          </Paper>
          <Paper sx={{ p: 2, minWidth: 120 }}>
            <Typography variant="body2" color="textSecondary">Architecture</Typography>
            <Typography variant="body1">Microservices</Typography>
          </Paper>
        </Box>
      </Box>
    </Container>
  );
};

export default HomePage;
